import logo from './logo.png';
import './App.css';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));


function App() {
  const classes = useStyles();
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> Fly At Will </p>

<form className={classes.root} noValidate autoComplete="off">
  <TextField id="standard-basic" label="Standard" />
  <TextField id="filled-basic" label="Filled" variant="filled" />
  <TextField id="outlined-basic" label="Outlined" variant="outlined" />
</form>

        <form>
          <label><TextField id="standard-basic" label="Standard" name="depart"/></label>
          <label>Arrival <input type="text" name="arr" /></label>
          <label>Date Outward<input type="date" name="Outward" /></label>
          <label>Date Inward<input type="date" name="Inward" /></label>
          <label>Trip Type
            <select name="type">
              <option value="oneWay">One Way</option>
              <option value="round">Round Trip</option>
            </select>
          </label>
          <Button type="submit" variant="contained" color="primary">Submit</Button>
        </form>
      </header>
    </div>
  );
}


export default App;
